import { countries } from "./data";
const countryStyles = {
  fontSize: "1rem",
  fontWeight: "bold",
  lineHeight: "1.5rem",
  color: "green",
  padding: "1rem",
  margin: "1rem",
  border: "1px solid black",
  borderRadius: "1rem",
};
const container = {
  fontSize: "1rem",
  fontWeight: "bold",
  lineHeight: "1.5rem",
  color: "yellow",
  padding: "1rem",
  margin: "1rem",
  border: "1px solid black",
  borderRadius: "1rem",
}

const cityStyles = {
  listStyle: "none",
  padding: 0,
  margin: 0,
};
function Country() {
  console.log(countries);
  return (
    <>
      <h1 style={countryStyles}>
        {countries.map((country) => (
          <p key={country.id} style={container}>
          {country.name}
            <ul style={cityStyles}>
              {country.cities.map((city) => (
                <li key={city.id} style={cityStyles}>
                  {city.name}
                </li>
              ))}
            </ul>
          </p>
        ))}
      </h1>
    </>
  );
}

export default Country;
